import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

/*import FunctionClick from './FunctionClick' ;*/

class App extends React.Component {
  render() {
  return (
   <div className="App">     
   <div class="nav">
    <button class="boutonco"  onClick={this.click}><span>Se connecter</span>
    </button>
  </div>  
    </div>
  );
}
click(){alert("Rania <3")}
}









export default App;
